package net.jeeshop.services.front.appPigFarm.dao;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.common.AppPigFarm;public class AppPigFarmDaoImpl implements AppPigFarmDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(AppPigFarm e) {		return dao.selectPageList("front.appPigFarm.selectPageList",				"front.appPigFarm.selectPageCount", e);	}	@Override	public List selectList(AppPigFarm e) {		return dao.selectList("front.appPigFarm.selectList", e);	}	@Override	public AppPigFarm selectOne(AppPigFarm e) {		return (AppPigFarm) dao.selectOne("front.appPigFarm.selectOne", e);	}	@Override	public int delete(AppPigFarm e) {		return dao.delete("front.appPigFarm.delete", e);	}	@Override	public int update(AppPigFarm e) {		return dao.update("front.appPigFarm.update", e);	}		@Override	public int insert(AppPigFarm e) {		return dao.insert("front.appPigFarm.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("front.appPigFarm.deleteById", id);	}	@Override	public AppPigFarm selectById(String id) {		return (AppPigFarm) dao.selectOne("front.appPigFarm.selectById", id);	}}